      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT + col0 / 3 NOT IN ( col1 + + - col2, - col1 + - col1 * + 46 * - col2 * + 40 * + col1 + - col1 - + col1, + + ( + + 30 ) );
  - name: tab2

outputs:
  - name: q4123.out
    data: |
